import React from 'react'
import GoogleMapReact from 'google-map-react';

function Map() {
  return (
    <div class="container">
        <GoogleMapReact
            bootstrapURLKeys = {{ key: ''}}>

        </GoogleMapReact>
    </div>
  );
}

export default Map;
